    mapping(uint256 => address) private _tokenApprovals;

    // Mapping from owner to operator approvals
    mapping(address => mapping(address => bool)) private _operatorApprovals;

    /**
     *[user][1] = last_block
     *[user][2] = accumulation_power   
     *[user][3] = accumulation_DCF    
    */   
    mapping(address => mapping(uint256 => uint256))private _mineInfo;      
    

    constructor(string memory name_, string memory symbol_, uint256 maxSupply_, uint256 salt_) {
        _name = name_;
        _symbol = symbol_;
        _maxSupply = maxSupply_;
        _currentIndex = _startTokenId(); 
        _salt = salt_;   
        _DCFperBlock = 2e18;   
        _totalPower = 46000;
        _startBlockNumber = block.number;    
    }
  



    function MineStatus(address user)public {
        uint256 difference = block.number.sub(_mineInfo[user][1]).add(1);
        uint256 start = blockStatus(_mineInfo[user][1]);
        uint256 end = blockStatus(block.number);
        uint256 a = start.add(end).mul(difference).div(2);

        uint dcf_amount = a.mul(_mineInfo[user][2]).div(_totalPower);
         _mineInfo[user][3].add(dcf_amount);       
    }

   


    function blockStatus (uint256 _BlockNumber)public view returns (uint256){
        uint256 a = _DCFperBlock.mul(1e18);   
        uint256 b = _BlockNumber.mul(1e18).div(_startBlockNumber);
        uint256 c = a.div(b);
        return c;    
    }


    function DcofferPower (uint256 tokenId)public view returns(uint256){
        uint _power = tokenId.mul(_salt).add(tokenId); 

        if(_power%10 == 0){
            _power = 1;
        }else{
            _power = _power%10;
        }

        return _power;
    }
    





   

